const Login = () => {
    return (
        <div>
            <form>
            <label htmlFor='email'>E-mail</label>
            <input type='text' />

            <label htmlFor='pass'>Password</label>
            <input type='text' />

            <button>Login</button>
            </form>

            <Form />
        </div>
    )
}

export default Login;
